import React from 'react'

const OrdersList = ({orders}) => {
  return (
    <div>
    {orders ? (orders.map(item =>{
        return(
        <div>
            {item.product.map(item =>{
                return(
                    <h4>{item.title}</h4>
                )
            })}
        </div>)
    })) 
    
    : (<h3>No Orders</h3>)}

    </div>
  )
}

export default OrdersList
